import React from 'react';
import $ from 'jquery';
import '../Style/Introduction.css';

class Introduction extends React.Component {

    componentDidMount = () => {
        $(document).ready(function (event) {
            event.preventDefault();

            $('.main-button')
        })
    }

    render(){
        return (
            <div className= "introduction">
                  <div className = "intro-panel">
                      <h1 className= "line-a">Hi, I am Nayan,</h1>
                      <h2 className= "line-b">a web developer specialized in</h2>
                      <h2 className= "line-c">front-end and back-end web development.</h2>
                  </div>

                  <div className = "buttons">
                      <a href = "#" className = "portfolio-button main-button">PORTFOLIO</a><br/><br/><br/>
                      <a href = "#" className = "skills-button main-button">SKILLS</a>
                  </div>
            </div>
        );
    }
}

export default Introduction;
